description:
Good Will Evil (2008)

A successful young politician wants a family, but his wife resists. She has emotional problems and can't accept the responsibility of motherhood. He finally convinces her to very reluctantly consider adoption. But, the child they choose brings problems with her beyond any they ever imagined.

